Since $\angle A = 45^\circ,$ $\overline{AD}$ is the median to $\overline{BC}.$  Hence, $BD = CD,$ so $BD = CD = 3.$  Then by Pythagoras on right triangle $ABD,$ $AB = 4.$

Let $h = AD.$  Then the area of triangle $ABC$ is
\[\frac{1}{2} \cdot BC \cdot h = \frac{1}{2} \cdot (BD + CD) \cdot h = \frac{1}{2} \cdot 6 \cdot h = \boxed{3h}.\]By Pythagoras on right triangle $ADB,$
\[h^2 = AB^2 - BD^2 = 16 - 9 = 7.\]Since $h > 0,$ $h = \sqrt{7}.$  Therefore, the area of triangle $ABC$ is $\boxed{3 \sqrt{7}}.$ The answer is: 3 \sqrt{7}

