Question: A prism is constructed so that its vertical edges are parallel to the $z$-axis.  Its cross-section is a square of side length 10.

[asy]
import three;

size(180);
currentprojection = perspective(6,3,2);

triple A, B, C, D, E, F, G, H;

A = (1,1,0);
B = (1,-1,0);
C = (-1,-1,0);
D = (-1,1,0);
E = A + (0,0,1);
F = B + (0,0,3);
G = C + (0,0,4);
H = D + (0,0,2);

draw(surface(E--F--G--H--cycle),gray(0.7),nolight);
draw(E--F--G--H--cycle);
draw(A--E);
draw(B--F);
draw(C--G,dashed);
draw(D--H);
draw(B--A--D);
draw(B--C--D,dashed);
[/asy]

The prism is then cut by the plane $4x - 7y + 4z = 25.$  Find the maximal area of the cross-section.
Answer:

output:
The equation $4x - 7y + 4z = 25$ represents a plane that intersects the $xy$-plane at the point $(5,-3).$  The normal vector to this plane is $\begin{pmatrix} 4 \\ -7 \\ 4 \end{pmatrix},$ which is not parallel to the face of the prism.  Therefore, the plane cuts through the prism, and we can find the cross-section by taking a $xy$-slices of the prism.

[asy]
import three;

size(180);
currentprojection = perspective(6,3,2);

triple A, B, C, D, E, F, G, H;

A = (1,1,0);
B = (1,-1,0);
C = (-1,-1,0);
D = (-1,1,0);
E = A + (0,0,1);
F = B + (0,0,3);
G = C + (0,0,4);
H = D + (0,0,2);

draw(surface(E--F--G--H--cycle),gray(0.7),nolight);
draw(E--F--G--H--cycle);
draw(A--E);
draw(B--F);
draw(C--G,dashed);
draw(D--H);
draw(B--A--D);
draw(B--C--D,dashed);
draw((5,-3,0)--B,dashed);
draw((5,-3,0)--A,dashed);
draw((5,-3,0)--D,dashed);
draw((5,-3,0)--C,dashed);

label("$4x - 7y + 4z = 25$", (5,-3,0), N);
[/asy]

The cross-section is then a square with side length $\sqrt{5^2 + (-3)^2} = 4.$  Therefore, the maximal area of the cross-section is $4^2 = \boxed{16}.$ The answer is: 16

