Then $\angle ACD = 180^\circ - \angle CAD - \angle BAD = 180^\circ - 2 \cdot 60^\circ = 60^\circ,$ so triangle $ACD$ is equilateral. Hence, $AC = AD = x,$ so $x = 3.$

Also, $\angle BAD = \angle BAC - \angle ACD = 90^\circ - 60^\circ = 30^\circ,$ so triangle $ABD$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle. Hence, $AB = 2 \cdot AD = 2x = 6,$ so $x = \boxed{3}.$ The answer is: 3

