Triangle $BCD$ is a right triangle since $\overline{BC}\perp\overline{AD}$.  Let $F$ be the foot of the altitude from $P$ to triangle $BCD$.  Since $\overline{PA}\perp\overline{AB}$, we have $\angle PFC = 90^\circ$.  Since $\overline{PA}\perp\overline{BC}$, we have $\angle PFB = 90^\circ$.  Therefore, $PFB$ is a right triangle.  By the Pythagorean Theorem, we have $PF^2 = PC^2 - PB^2 = 5^2 - 3^2 = 16$ and $FB^2 = BC^2 - BD^2 = 2^2 - 3^2 = 7$.  Therefore, \[[PABCD] = \frac{1}{3}(PF)(FB) = \frac{1}{3}(4\sqrt{7})(2) = \boxed{8\sqrt{7}}.\] The answer is: 8\sqrt{7}

