Question: Steve has an isosceles triangle with base 8 inches and height 10 inches. He wants to cut it into eight pieces that have equal areas, as shown below. To the nearest hundredth of an inch what is the number of inches in the greatest perimeter among the eight pieces? [asy]
size(150);
defaultpen(linewidth(0.7));
draw((0,0)--(8,0));
for(int i = 0; i < 9; ++i){
draw((4,10)--(i,0));
}
draw((0,-0.5)--(8,-0.5),Bars(5));
label("$8''$",(0,-0.5)--(8,-0.5),S);
[/asy]
Answer:

output:
We first notice that the triangle can be split into four congruent triangles by drawing the altitude from the vertex opposite the base. [asy]
size(150);
defaultpen(linewidth(0.7));
draw((0,0)--(8,0));
for(int i = 0; i < 9; ++i){
draw((4,10)--(i,0));
}
draw((0,-0.5)--(8,-0.5),Bars(5));
label("$8''$",(0,-0.5)--(8,-0.5),S);
draw((4,0)--(4,10),dashed);
[/asy] Since the triangle is isosceles, the altitude from the vertex opposite the base will also be a median. This means that the triangle can be split into two congruent triangles by drawing the midline of the base. [asy]
size(150);
defaultpen(linewidth(0.7));
draw((0,0)--(8,0));
for(int i = 0; i < 9; ++i){
draw((4,10)--(i,0));
}
draw((0,-0.5)--(8,-0.5),Bars(5));
label("$8''$",(0,-0.5)--(8,-0.5),S);
draw((4,0)--(4,10),dashed);
draw((0,5)--(8,5));
[/asy] We now have a triangle that is split into eight congruent pieces. Each piece has height $5$ inches and base $2$ inches. The perimeter of each piece is then $2+5+5+2=14$ inches. The greatest perimeter among the eight pieces is then $8\times14=\boxed{112}$ inches. The answer is: 112

